export class EvaluationRendement {
    PatientId: number;
    Evaluation: boolean;
    EvaluationTxt?: string;
    Rendement: string;
    Osteonecrose: boolean;
    DateApparition?: string; 
    Siege?: string;
    Stade?: string;
    Symptomatique: boolean;
    RadioStandard: boolean;
    TxtRadio?: string;
    IrmArticulation: boolean;
    TxtIrm?: string;
    TraitementChirurgical: boolean;
    DateTraitement?: string; 
    TxtTritement?: string;
  
    constructor() {
      this.PatientId = 0;
      this.Evaluation = false;
      this.EvaluationTxt = '';
      this.Rendement = '';
      this.Osteonecrose = false;
      this.DateApparition = ''; 
      this.Siege = '';
      this.Stade = '';
      this.Symptomatique = false;
      this.RadioStandard = false;
      this.TxtRadio = '';
      this.IrmArticulation = false;
      this.TxtIrm = '';
      this.TraitementChirurgical = false;
      this.DateTraitement = ''; 
      this.TxtTritement = '';
    }
  }
